import React from "react";
import binaryImage from "../assets/image-binary-code.png"; 
import CategorySubPage from "../components/CategorySubPage";

const WebExploitation = () => {
  return (
    <CategorySubPage
      title="Web Exploitation"
      description="Welcome to the Web Exploitation category! Here you will find challenges related to web security. Test your skills in identifying vulnerabilities, exploiting them, and securing web applications."
      imageSrc={binaryImage}
      buttons={[
        { text: "Start Challenges", path: "/web-exploitation/challenges" },
      ]}
    />
  );
};

export default WebExploitation;
